import React, { useEffect, useState } from "react";
import axios from "axios";
import { getAccessToken } from "../utils/authUtils";
import { stompClient } from "../api/websocket";
import "../styles/InviteList.css";

const InviteList = ({ refreshProjects }) => {
    const [invites, setInvites] = useState([]);
    const [notifications, setNotifications] = useState([]);

    useEffect(() => {
        const fetchInvites = async () => {
            const token = getAccessToken();
            try {
                const response = await axios.get("http://localhost:8082/api/team/invites", {
                    headers: { Authorization: `Bearer ${token}` },
                });
                console.log("üìå Î∞õÏùÄ Ï¥àÎåÄ Î™©Î°ù:", response.data);
                setInvites(response.data);
                setNotifications(response.data.filter(invite => invite.status === "PENDING"));
            } catch (error) {
                console.error("‚ùå Ï¥àÎåÄ Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error);
            }
        };

        fetchInvites();

        stompClient.onConnect = (frame) => {
            console.log("‚úÖ WebSocket Ïó∞Í≤∞ ÏÑ±Í≥µ:", frame);
            stompClient.subscribe("/topic/invites", (message) => {
                console.log("üì© ÏÉà Ï¥àÎåÄ ÏïåÎ¶º ÏàòÏã†:", message.body);
                const newInvite = JSON.parse(message.body);

                if (newInvite.status === "PENDING") {
                    setNotifications((prev) => [...prev, newInvite]);
                }
            });
        };

        stompClient.activate();

        return () => {
            stompClient.deactivate();
        };
    }, []);

    // ‚úÖ "ÌôïÏù∏" Î≤ÑÌäº ÌÅ¥Î¶≠ Ïãú Ïã§ÌñâÎê† Ìï®Ïàò
    const handleAcceptInvite = async (inviteId) => {
      let token = getAccessToken();
      if (!token) {
          alert("Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
          navigate("/login");
          return;
      }

      try {
          const response = await axios.post(
              `http://localhost:8082/api/team/accept-invite/${inviteId}`, 
              {}, 
              {
                  headers: { Authorization: `Bearer ${token}` },
              }
          );

          console.log(`‚úÖ Ï¥àÎåÄ ${inviteId} ÏàòÎùΩÎê®`);

          setNotifications((prev) => prev.filter(n => n.id !== inviteId));
          setInvites((prev) => prev.filter(i => i.id !== inviteId));

          console.log("üîÑ ÌîÑÎ°úÏ†ùÌä∏ Î™©Î°ù Í∞±Ïã† ÏöîÏ≤≠ Ïã§Ìñâ");
          refreshProjects(); // ‚úÖ ÌîÑÎ°úÏ†ùÌä∏ Î™©Î°ù Í∞±Ïã†
      } catch (error) {
          if (error.response?.status === 401) {
              console.warn("üîÑ ÌÜ†ÌÅ∞ ÎßåÎ£å Í∞êÏßÄ, ÏÉà ÌÜ†ÌÅ∞ ÏöîÏ≤≠...");
              token = await refreshAccessToken(); // üîπ ÏÉàÎ°úÏö¥ Ïï°ÏÑ∏Ïä§ ÌÜ†ÌÅ∞ ÏöîÏ≤≠
              if (!token) {
                  alert("ÏÑ∏ÏÖòÏù¥ ÎßåÎ£åÎêòÏóàÏäµÎãàÎã§. Îã§Ïãú Î°úÍ∑∏Ïù∏Ìï¥Ï£ºÏÑ∏Ïöî.");
                  navigate("/login");
                  return;
              }

              // üîπ ÏÉàÎ°úÏö¥ ÌÜ†ÌÅ∞ÏúºÎ°ú Îã§Ïãú ÏöîÏ≤≠
              try {
                  const response = await axios.post(
                      `http://localhost:8082/api/team/accept-invite/${inviteId}`, 
                      {}, 
                      {
                          headers: { Authorization: `Bearer ${token}` },
                      }
                  );
                  console.log(`‚úÖ Ï¥àÎåÄ ${inviteId} Ïû¨ÏãúÎèÑ ÌõÑ ÏàòÎùΩÎê®`);

                  setNotifications((prev) => prev.filter(n => n.id !== inviteId));
                  setInvites((prev) => prev.filter(i => i.id !== inviteId));

                  console.log("üîÑ ÌîÑÎ°úÏ†ùÌä∏ Î™©Î°ù Í∞±Ïã† ÏöîÏ≤≠ Ïã§Ìñâ");
                  refreshProjects();
              } catch (retryError) {
                  console.error(`üö® Ïû¨ÏãúÎèÑ ÌõÑÏóêÎèÑ Ï¥àÎåÄ ÏàòÎùΩ Ïã§Ìå®: ${inviteId}`, retryError);
              }
          } else {
              console.error(`üö® Ï¥àÎåÄ ÏàòÎùΩ Ïã§Ìå®: ${inviteId}`, error);
          }
      }
  };



    return (
        <>
            <div className="invite-popup-container">
                {notifications.length > 0 ? (
                    notifications.map((invite) => (
                        <div key={invite.id} className="invite-popup">
                            <p>
                                <strong>{invite.sender.username}</strong> ÎãòÏù¥ <strong>{invite.project.name}</strong> ÌîÑÎ°úÏ†ùÌä∏Ïóê Ï¥àÎåÄÌñàÏäµÎãàÎã§.
                            </p>
                            <button onClick={() => handleAcceptInvite(invite.id)}>
                                ‚úÖ ÌôïÏù∏
                            </button>
                        </div>
                    ))
                ) : (
                    <p className="no-invites">üìå ÏÉàÎ°úÏö¥ Ï¥àÎåÄÍ∞Ä ÏóÜÏäµÎãàÎã§.</p>
                )}
            </div>
        </>
    );
};

export default InviteList;
